import React from "react";
import "./SplashScreen.css";

function SplashScreen() {
  return (
    <div className="HomePage">
      <div className="HomePage_inner">
        <h1>
          Food-<span>D</span>
        </h1>
      </div>
      <div className="HomePage_Footer">
        <h5>RKFD</h5>
      </div>
    </div>
  );
}

export default SplashScreen;
